import React, { Component } from 'react';

import classes from './Auth.module.css'

class Auth extends Component {
    state={

    }
    render() { 
        return ( 
            <div className={classes.Auth}>
                <h3>Nook Admin</h3>
                <form>
                <label>
                    <p>User</p>
                    <input required type="email" placeholder="ingresa tu email"/>
                </label>
                <label>
                    <p>Password</p>
                    <input required type="password" placeholder="ingresa password"/>
                </label>
                <button type="submit">Login</button>
                </form>
            </div>
         );
    }
}
 
export default Auth;
